%pyspark
def DTWDistance(s1, s2,w):
    DTW={}

    w = np.fmax(w, np.abs(len(s1)-len(s2)))

    for i in range(-1,len(s1)):
        for j in range(-1,len(s2)):
            DTW[(i, j)] = float('inf')
    DTW[(-1, -1)] = 0

    for i in range(len(s1)):
        for j in range(np.fmax(0, i-w), np.fmin(len(s2), i+w)):
            dist= (s1[i]-s2[j])**2
            DTW[(i, j)] = dist + np.fmin(DTW[(i-1, j)],np.fmin(DTW[(i, j-1)], DTW[(i-1, j-1)]))

    return np.sqrt(DTW[len(s1)-1, len(s2)-1])

def LB_Keogh(s1,s2,r):
    LB_sum=0
    for ind,i in enumerate(s1):

        lower_bound=np.amin(s2[(ind-r if ind-r>=0 else 0):(ind+r)])
        upper_bound=np.amax(s2[(ind-r if ind-r>=0 else 0):(ind+r)])

        if i>upper_bound:
            LB_sum=LB_sum+(i-upper_bound)**2
        elif i<lower_bound:
            LB_sum=LB_sum+(i-lower_bound)**2

    return np.sqrt(LB_sum)

